import React from "react";
import styled from "styled-components";

export default  function TableRow(){
    return(
        <tr>
        <td>
            <div style={{display:"inline-block"}} className="flex justify-between align-center">
            <Img  src="./assets/images/chrome.png"/>
            <Para  >Chrome<span>(12k)</span></Para>
            </div>
        </td>
        <td> <Para  >India<span>(15k)</span></Para></td>
        <td>
            <div className="flex justify-between align-start flex-direction-column">
                 <div className="flex justify-start align-center">
                     <span style={{color:"rgb(75,80,85)"}}>01/01</span>
                     <Graph src="./assets/images/Group 94.png"/>
                </div>
            </div>
        </td>
      </tr>
    );
}


const Img = styled.img`
    margin-right: .75rem;
    height:1.2rem;
`;

const Graph = styled(Img)`heigth:2rem`;

const Para = styled.p`
     background-color:#ffffff;
     color:rgb(75,80,85);
     font-weight:400;
     font-size: 1.1rem;
     display:inline-block;
     vertical-align:text-top;
    &  span{
        color: rgb(44,142,191);
    }
`;
